import Home from './components/Home';
import './css/App.css';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom'

function App() {

  return (
    <Router>
    <div className="app">
      <Route path="/test" component="{Home}"/> 
    </div>
    </Router>
  );
}

export default App;
